    res.locals.user = {
        isAuthenticated: true,
        id: 5
    };
    next ();
};


// form의 경로를 가져오기 위한 molter 미들웨어.
export const mwUploadVideoSingle = (fieldName) => uploadVideo.single(fieldName);

